<?php

declare(strict_types=1);

namespace App\Tests\Functional\Service\Search\Provider;

use App\Entity\Search\UkrMissed\UkrMissedDisappearedPersons;
use App\Entity\Search\UkrMissed\UkrMissedPerson;
use App\Entity\Search\UkrMissed\UkrMissedWantedPersons;
use App\Enum\Feedback\SearchTermType;
use App\Enum\Search\SearchProviderName;
use App\Tests\Traits\Search\SearchProviderTrait;
use Symfony\Bundle\FrameworkBundle\Test\KernelTestCase;
use Generator;
use DateTimeImmutable;

class UkrMissedSearchProviderTest extends KernelTestCase
{
//    use SearchProviderTrait;

    protected static SearchProviderName $searchProviderName = SearchProviderName::ukr_missed;

    public function supportsDataProvider(): Generator
    {
        yield 'not supported type' => [
            'type' => SearchTermType::facebook_username,
            'term' => 'слово перше',
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => false,
        ];

        yield 'person name & not ukr' => [
            'type' => SearchTermType::person_name,
            'term' => 'слово перше',
            'context' => [
                'countryCode' => 'us',
            ],
            'expected' => false,
        ];

        yield 'person name & one word' => [
            'type' => SearchTermType::person_name,
            'term' => 'слово',
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => false,
        ];

        yield 'person name & not cyrillic' => [
            'type' => SearchTermType::person_name,
            'term' => 'any word',
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => false,
        ];

        yield 'person name & ok' => [
            'type' => SearchTermType::person_name,
            'term' => 'слово перше',
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => true,
        ];
    }

    public function searchDataProvider(): Generator
    {
        $yieldDisappeared = static fn (string $name): array => [
            'type' => SearchTermType::person_name,
            'term' => $name,
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => [
                new UkrMissedDisappearedPersons([
                    new UkrMissedPerson(
                        surname: 'АНДРУЩЕНКО',
                        name: 'ТЕТЯНА',
                        middleName: 'ЛЕОНІДІВНА',
                        sex: 'ЖІНОЧА',
                        birthday: new DateTimeImmutable('1969-02-11'),
                        photo: '',
                        category: 'ОСОБА, ЗНИКЛА БЕЗВІСТИ',
                        disappeared: true,
                        articles: [],
                        date: new DateTimeImmutable('1994-05-18'),
                        organ: 'СОЛОМ’ЯНСЬКЕ УПРАВЛІННЯ ПОЛІЦІЇ ГУНП В М. КИЄВІ',
                        precaution: '',
                        address: 'УКРАЇНА, СОЛОМЕНСКИЙ, КИЕВ',
                    ),
                ]),
            ],
        ];

        yield 'disappeared & person name & last first' => $yieldDisappeared('Андрущенко ТЕТЯНА');

        yield 'disappeared & person name & first last' => $yieldDisappeared('ТЕТЯНА Андрущенко');

        yield 'disappeared & person name & last first patronymic' => $yieldDisappeared('Андрущенко ТЕТЯНА ЛЕОНІДІВНА');

        yield 'disappeared & person name & first last patronymic' => $yieldDisappeared('ТЕТЯНА Андрущенко ЛЕОНІДІВНА');

        $yieldWanted = static fn (string $name): array => [
            'type' => SearchTermType::person_name,
            'term' => $name,
            'context' => [
                'countryCode' => 'ua',
            ],
            'expected' => [
                null,
                new UkrMissedWantedPersons([
                    new UkrMissedPerson(
                        surname: 'АНДРУЩЕНКО',
                        name: 'НАТАЛІЯ',
                        middleName: 'ІВАНІВНА',
                        sex: 'ЖІНОЧА',
                        birthday: new DateTimeImmutable('1976-03-01'),
                        photo: null,
                        category: 'ДЕЗЕРТИР (МО, СБУ, МВС УКРАЇНИ)',
                        disappeared: false,
                        articles: [
                            'СТ.408 Ч.2',
                        ],
                        date: new DateTimeImmutable('2014-12-24'),
                        organ: 'ВІННИЦЬКЕ РАЙОННЕ УПРАВЛІННЯ ПОЛІЦІЇ ГУНП У ВІННИЦЬКІЙ ОБЛАСТІ',
                        precaution: 'УХВАЛА СУДУ ПРО ДОЗВІЛ НА ЗАТРИМАННЯ  З МЕТОЮ ПРИВОДУ',
                        address: 'УКРАЇНА, КРЫМ, СЕВАСТОПОЛЬ',
                    ),
                ]),
            ],
        ];

        yield 'wanted & person name & last first' => $yieldWanted('Андрущенко НАТАЛІЯ');

        yield 'wanted & person name & first last' => $yieldWanted('НАТАЛІЯ Андрущенко');

        yield 'wanted & person name & last first patronymic' => $yieldWanted('Андрущенко НАТАЛІЯ ІВАНІВНА');

        yield 'wanted & person name & first last patronymic' => $yieldWanted('НАТАЛІЯ Андрущенко ІВАНІВНА');
    }
}